/**Logo Slide **/
function preloadImages(logos, callback) {
  let loadedCounter = 0;
  let imageData = []; // This will store both the image URLs and their aspect ratios
  let errorData = []; // This will store URLs that failed to load

  for (let i = 0; i < logos.length; i++) {
    let img = new Image();

    img.onload = function () {
      let aspectRatio = img.width / img.height;
      imageData.push({
        url: logos[i].logo,
        name: logos[i].name,
        aspectRatio: aspectRatio,
      });

      loadedCounter++;
      if (loadedCounter === logos.length) {
        callback(imageData, errorData); // Pass the imageData and errorData arrays to the callback when all images are loaded
      }
    };

    img.onerror = function () {
      errorData.push({
        url: logos[i].logo,
        name: logos[i].name,
        error: "Failed to load image",
      });

      loadedCounter++;
      if (loadedCounter === logos.length) {
        callback(imageData, errorData); // Pass the imageData and errorData arrays to the callback when all images are loaded
      }
    };

    img.src = logos[i].logo;
  }
}
function createLogoSlide(imageData) {
  console.log(imageData);

  const maxLogosPerSlide = 50;
  let currentLogoCount = 0;
  let imageCounter = 0; // Counter to keep track of the image index in imageData
  let pptx = new PptxGenJS(); // Create a new instance of PptxGenJS for each presentation
  pptx.layout = "LAYOUT_16x9";
  pptx.defineSlideMaster({
    title: "Default_ZMC",
    background: { color: "FFFFFF" },
    objects: [
      {
        image: {
          x: 0.5,
          y: 0.26,
          w: 0.39,
          h: 0.77,
          path: "https://tszpwpclmrfglzjncrjb.supabase.co/storage/v1/object/public/public-files/ZMC-Logo.png",
        },
      },
      {
        placeholder: {
          options: {
            name: "title",
            type: "title",
            x: 1.2,
            y: 0.28,
            w: 8.3,
            h: 0.73,
            fontFace: "Arial",
            fontSize: 22,
            bold: true,
            align: "left",
          },
          text: "Click to edit the title text format",
        },
      },
    ],
  });
  let slide = pptx.addSlide({ masterName: "Default_ZMC" }); // Create the initial slide

  slide.addImage({
    path: logoGrid,
    x: 0.5,
    y: 1.74,
    w: 9,
    h: 3.42,
  });

  function addLogosToSlide() {
    let gridX = 0.5,
      gridY = 1.74,
      gridW = 9,
      gridH = 3.7;
    let cols = 10,
      rows = 10;
    let horizontalMargin = 0.06; // Horizontal margin on each side
    let verticalMargin = 0.04; // Vertical margin on each side
    let cellWidth = gridW / cols;
    let defaultCellHeight = 0.29; // Height for even rows
    let alternateCellHeight = 0.53; // Height for the first odd row
    let alternateCellHeightSmall = 0.48; // Height for subsequent odd rows
    let largerCellHeight = 0.36; // Height for logos with wider aspect ratios
    let currentY = gridY;

    for (let i = 0; i < rows && imageCounter < imageData.length; i++) {
      let cellHeight;

      if (i % 2 === 0) {
        cellHeight = defaultCellHeight; // Even rows
      } else if (i === 1) {
        cellHeight = alternateCellHeight; // First odd row
      } else {
        cellHeight = alternateCellHeightSmall; // Subsequent odd rows
      }

      if (i % 2 === 0) {
        // Only add logos on even rows (0, 2, 4, ...)
        for (let j = 0; j < cols && imageCounter < imageData.length; j++) {
          if (currentLogoCount >= maxLogosPerSlide) {
            // Create a new slide and reset the counter
            slide = pptx.addSlide({ masterName: "Default_ZMC" });
            currentLogoCount = 0;
            currentY = gridY; // Reset the vertical position for the new slide
          }

          let imgData = imageData[imageCounter];
          let aspectRatio = imgData.aspectRatio;
          let isSquareOrPortrait = aspectRatio <= 1;
          let is4by3Or16by10 = aspectRatio > 1 && aspectRatio <= 1.6; // 4:3 and 16:10
          let is16by9 = aspectRatio > 1.6 && aspectRatio <= 1.78; // Approximately 16:9

          let adjustedCellHeight = cellHeight;
          if (isSquareOrPortrait || is4by3Or16by10) {
            adjustedCellHeight *= 1.5;
          } else if (is16by9) {
            adjustedCellHeight = largerCellHeight;
          }

          let cellAspectRatio =
            (cellWidth - 2 * horizontalMargin) /
            (adjustedCellHeight - 2 * verticalMargin);
          let scaledWidth, scaledHeight;

          if (aspectRatio > cellAspectRatio) {
            scaledWidth = cellWidth - 2 * horizontalMargin;
            scaledHeight = scaledWidth / aspectRatio;
          } else {
            scaledHeight = adjustedCellHeight - 2 * verticalMargin;
            scaledWidth = scaledHeight * aspectRatio;
          }

          let imgX =
            gridX +
            j * cellWidth +
            horizontalMargin +
            (cellWidth - 2 * horizontalMargin - scaledWidth) / 2;
          let imgY =
            currentY + defaultCellHeight - verticalMargin - scaledHeight;

          // Ensure all logos respect the padding and baseline
          if (scaledHeight > defaultCellHeight - 2 * verticalMargin) {
            imgY = currentY + defaultCellHeight - verticalMargin - scaledHeight;
          } else if (isSquareOrPortrait || is4by3Or16by10) {
            // Align square, portrait, 4:3, and 16:10 logos to the baseline
            imgY = currentY + defaultCellHeight - verticalMargin - scaledHeight;
          } else if (is16by9) {
            // Center 16:9 logos within the default cell height
            imgY = currentY + (defaultCellHeight - scaledHeight) / 2;
          } else {
            // For logos wider than 16:9, place slightly off the baseline and centered
            imgY =
              currentY +
              (defaultCellHeight - scaledHeight) / 2 -
              verticalMargin;
          }

          slide.addImage({
            path: imgData.url,
            x: imgX,
            y: imgY,
            w: scaledWidth,
            h: scaledHeight,
          });

          imageCounter++;
          currentLogoCount++;
        }
      }

      // Update the current Y position for the next row
      currentY += cellHeight;
    }
  }

  while (imageCounter < imageData.length) {
    addLogosToSlide(); // Add logos to slides until all logos are placed
  }

  // Write the file
  pptx.writeFile({ fileName: "LogoSlidePresentation.pptx" });
}

function logoSlide(logoObjects) {
  // Sort the logoObjects array by the name property
  logoObjects.sort((a, b) => {
    // Convert names to strings (in case they are not)
    const nameA = String(a.name);
    const nameB = String(b.name);

    // Use localeCompare to consider numbers, capital and lowercase letters
    return nameA.localeCompare(nameB, undefined, {
      numeric: true,
      sensitivity: "base",
    });
  });

  // Preload images after sorting
  preloadImages(logoObjects, function (imageData) {
    console.log("All images preloaded");
    createLogoSlide(imageData);
  });
}

